import React, { Component } from 'react';


const FlightsTableRow = ({ route, getAirlineById }) => {
  const airlineName = getAirlineById(route.airline)
  console.log(airlineName)
  return (
    <>
      <td>{airlineName}</td>
      <td>{route.src}</td>
      <td>{route.dest}</td>
    </>
  )
}

export default FlightsTableRow
